UPDATE `itreports` SET `SQL_RPT`='Select h.Codigo_EMI, h.Fecha_EMI, h.Codigo_USR, ID_TER as \'Pasaporte\', Nombre_TER as \'Nombres\', Fecha_CTZ as \'Fecha Cotizacion\', Nombre_AGE as \'Agencia\', Nombre_USR as \'Promotor\', nombre_pla as \'Plan\', Modalidad_CTZ as \'Modalidad\', f.nombre_dst as \'Procedencia\', g.nombre_dst as \'Destino\', FechaIni_CTZ as \'Fecha Inicio\', FechaFin_CTZ as \'Fecha Fin\', Dias_CTZ as \'D铆as\', TRM_CTZ as \'T.R.M.\', Dolares_CTZ as \'Valor en Dolares\', format(Pesos_CTZ, 2) as \'Valor en Pesos\', Voucher_CTZ as \'Voucher\'\r\n				From czterceros a, klcotizaciones b, itusuarios c, klagencias d, klplanes e, kldestinos f, kldestinos g, klemisiones h\r\n				Where a.codigo_ter=b.codigo_ter and c.codigo_usr=b.codigo_usr and d.codigo_age=b.codigo_age and e.codigo_pla=b.codigo_pla and  \r\n				f.codigo_dst=procedencia_ctz and g.codigo_dst=b.codigo_dst and\r\n				b.codigo_ctz=h.Codigo_CTZ and estado_ctz=\'2\' and h.Codigo_EMI>=\'@EMISION_INICIAL\' and h.Codigo_EMI<=\'@EMISION_FINAL\' and h.Estado_EMI<>\'0\'' WHERE  `Codigo_RPT`='klemisiones' AND `Codigo_DCD`=0;
